import React, { Component } from 'react';

class DoneListItem extends Component {
    render() {
        return (
            <li>{this.props.Name}<button className="btn btn-xs pull-right"><span className="glyphicon glyphicon-remove" /></button></li>
        );
    }
}

export default DoneListItem;
